import React from 'react';

const BrewItem = ({ brew, onEdit, onDelete }) => {
    return (
        <div className="brew-item">
            <h3>{brew.name}</h3>
            <p><strong>Bean: </strong>{brew.beanType}</p>
            <p><strong>Method:</strong> {brew.method}</p>
            <p><strong>Coffee Grams: </strong>{brew.coffeeGrams}</p>
            <p><strong>Water Grams: </strong>{brew.waterGrams}</p>
            <p><strong>Rating: </strong>{brew.rating}</p>
            <p><strong>Notes: </strong> {brew.notes}</p>
            <button onClick={() => onEdit(brew.id)}>Edit</button>
            <button onClick={() => onDelete(brew.id)}>Delete</button>
        </div>
    );
};

export default BrewItem;
